class Solution:
    def dfs(self,grid,i,j,n,m,groupmark,groups):
        
        mark = ''
        if groupmark == '+':
            mark = str(i)+str(j)
        else:
            mark = groupmark
        
        groups[i*m+j] = mark
        
        if  not (i-1>n-1 or i-1<0 or j>m-1 or j<0 or groups[(i-1)*m+j] != None or grid[i-1][j] == 0):
            self.dfs(grid,i-1,j,n,m,mark,groups)
        if  not (i+1>n-1 or i+1<0 or j>m-1 or j<0 or groups[(i+1)*m+j] != None or grid[i+1][j] == 0):
            self.dfs(grid,i+1,j,n,m,mark,groups)
        if  not (i>n-1 or i<0 or j-1>m-1 or j-1<0 or groups[i*m+j-1] != None or grid[i][j-1] == 0):
            self.dfs(grid,i,j-1,n,m,mark,groups)
        if  not (i>n-1 or i<0 or j+1>m-1 or j+1<0 or groups[i*m+j+1] != None or grid[i][j+1] == 0):
            self.dfs(grid,i,j+1,n,m,mark,groups)    
        
        
    def numIslands(self, grid):
        """
        :type grid: List[List[str]]
        :rtype: int
        """
        if grid == None or len(grid) == 0 or len(grid[0]) == 0:
            return 0
        
        n = len(grid)
        m = len(grid[0])
        
        groups = [None]*(n*m)
        
        for i in range(n):
            for j in range(m):
                if groups[i*m+j] == None:
                    if  not (groups[i*m+j] != None or grid[i][j] == '0'):
                        self.dfs(grid,i,j,n,m,'+',groups)
                
        s = set(groups)
        if None in groups:
            return len(s)-1
        else:
            return len(s)
        
